import { React, useState } from "react";
import { ReactComponent as Logo } from "./sun.svg";
import { ReactComponent as Search } from "./search.svg";
import "./css/header.css";
import axios from "axios";
function Header() {
  const [state, setstate] = useState(false);
  const [name, setname] = useState();
  const toget = (e) => {
    setname(e.target.value);
    if (name) {
      const a = axios.get(
        `http://api.openweathermap.org/data/2.5/weather?q=${name}&appid=7ea1cdf8496c6f6dd2a3b94c6e8efc0d`
      );
      a.then((res) => {
        console.log(res);
      });
    }
  };
  return (
    <header>
      <nav className="navbar">
        <Logo className="sun" />
        <h2 className="navbar__heading">MYweather</h2>
      </nav>
      <form>
        <div className="input">
          <Search id="search" />
          <input
            type="text"
            onChange={(e) => {
              toget(e);
            }}
            className="weather_input"
          />
          <button type="submit">Search</button>
        </div>
      </form>
      <div className="result" id={!state ? "none" : ""}>
        <h1 className="location_name">Location Name</h1>
        <div className="flex-to">
          <h1 className="temprature">Temp: 23c</h1>
          <div className="winds">
            <h3 className="wind">Wind: </h3>
            <h3 className="wind_speed">Wind Speed</h3>
          </div>
        </div>
        <h2 className="clouds">Cloud: Cloudy</h2>
      </div>
    </header>
  );
}

export default Header;
